import React from "react";
import Auth from "../auth.js";

const auth = new Auth();

const LoginContainer = () => {
  const { isAuthenticated } = auth;

  if (!isAuthenticated) {
    return <div>Need to Login</div>;
  }
  return (
    <div>
      <p>Hey</p>
    </div>
  );
};

export default LoginContainer;
